// src/App.jsx
import React from "react";
import Navbar from "./components/Navbar";
import CommandInput from "./components/CommandInput";
import FileUpload from "./components/FileUpload";
import LiveLatencyCard from "./components/LiveLatencyCard";
import SessionHistory from "./components/SessionHistory";
import Footer from "./components/Footer";
import ParticlesBackground from "./components/ParticlesBackground";
import { motion } from "framer-motion";
import { stagger } from "./utils/motionVariants";

export default function App() {
  return (
    <motion.div
      variants={stagger}
      initial="hidden"
      animate="show"
      className="relative gradient-bg flex flex-col items-center min-h-screen overflow-hidden"
    >
      <ParticlesBackground />
      <Navbar />
      <main className="flex flex-col items-center justify-center flex-1 p-6 gap-6 mt-16 z-10">
        <CommandInput />
        <FileUpload />
        <LiveLatencyCard />
        <SessionHistory />
      </main>
      <Footer />
    </motion.div>
  );
}
